import React from 'react';
import { Icon } from 'semantic-ui-react';

export const DeleteIcon = (hovering) => {
  return (
    <Icon 
      name='times'
      size='small'
      style={{ visibility: hovering ? "visible" : "hidden" }}
    />
  )
};
